import React from 'react'
import './Photos.css'

const Photos = () => {
    return (
        <div className='Photos'>
            <h1>Photos</h1>
            <div><img src='https://vectorforfree.com/wp-content/uploads/2018/11/01_Fashion-People-Vector-For-Free.png'></img></div>
        </div>
    )
}

export default Photos
